class Tag {
    constructor() {
        this.state = {
            tags:[""]
        };
    }

    addTag(text) {
        this.state.tags = [
            ...this.state.tags,
            text
        ];
    }

    getTags() {
        return this.state.tags;
    }

    getTagByText(text) {
        return this.state.tags.filter(item => item.includes(text));
    }
}
const TagInstance = new Tag();
export default TagInstance;
